def solve():
    n = int(input())
    droplets = []
    for _ in range(n):
        x, y, vx, vy, r = map(int, input().split())
        droplets.append((x, y, vx, vy, r))

    def distance(d1, d2):
        return ((d1[0] - d2[0])**2 + (d1[1] - d2[1])**2)**0.5

    def area(d):
        return 3.14159 * d[4]**2

    def area_weighted_average(d1, d2):
        x1, y1, vx1, vy1, r1 = d1
        x2, y2, vx2, vy2, r2 = d2
        area1 = area(d1)
        area2 = area(d2)
        total_area = area1 + area2
        x_avg = (area1 * x1 + area2 * x2) / total_area
        y_avg = (area1 * y1 + area2 * y2) / total_area
        vx_avg = (area1 * vx1 + area2 * vx2) / total_area
        vy_avg = (area1 * vy1 + area2 * vy2) / total_area
        return (x_avg, y_avg, vx_avg, vy_avg, (area1 + area2)**0.5)

    def check_collision(d1, d2, t):
        x1, y1, vx1, vy1, r1 = d1
        x2, y2, vx2, vy2, r2 = d2
        x_t = x1 + vx1 * t
        y_t = y1 + vy1 * t
        x2_t = x2 + vx2 * t
        y2_t = y2 + vy2 * t
        return distance((x_t, y_t), (x2_t, y2_t)) <= r1 + r2

    def find_agglomeration_time(droplets):
        n = len(droplets)
        for i in range(n):
            for j in range(i + 1, n):
                d1 = droplets[i]
                d2 = droplets[j]
                t = 0
                while check_collision(d1, d2, t):
                    t += 0.001
                if t > 0:
                    return t
        return 0

    agglomeration_time = find_agglomeration_time(droplets)
    if agglomeration_time == 0:
        print(n, 0.0)
        return

    new_droplets = []
    for d1 in droplets:
        for d2 in droplets:
            if d1 != d2:
                if check_collision(d1, d2, agglomeration_time):
                    new_droplet = area_weighted_average(d1, d2)
                    new_droplets.append(new_droplet)
                    break
        else:
            new_droplets.append(d1)
    else:
        new_droplets = droplets

    print(len(new_droplets), agglomeration_time)

