            if char == 'G' and last_char == 'G' and last_char == 'C':
                continue
            if char == 'T' and last_char == 'G' and last_char == 'C':
                continue
            count = (count + count_strings(length - 1, char)) % MOD

        dp[(length, last_char)] = count
        return count

    total_strings = 0
