                    count += 1
        for j in range(c):
            if j not in eaten:
                if grid[row][j] == '.':
                    count += 1
        return count

    def backtrack(row, col, eaten, max_eaten):
        if row == r and col == c:
            return max_eaten

        max_eaten = max(max_eaten, count_eaten_cells(row, col, eaten))

        if row < r:
            new_eaten = eaten.copy()
            new_eaten.add(row)
            max_eaten = max(max_eaten, backtrack(row + 1, col, new_eaten, max_eaten))

        if col < c:
            new_eaten = eaten.copy()
            new_eaten.add(col)
            max_eaten = max(max_eaten, backtrack(row, col + 1, new_eaten, max_eaten))

        return max_eaten

    max_eaten = backtrack(0, 0, set(), 0)
    print(max_eaten)

