    roads = []
    for _ in range(m):
        roads.append(tuple(map(int, input().split())))

    adj = [[] for _ in range(n)]
    for u, v, w in roads:
        adj[u].append((v, w))
        adj[v].append((u, w))

    def is_reachable(start, end, range_val):
        visited = [False] * n
        visited[start] = True
        queue = [(start, 0)]

        while queue:
            curr, dist = queue.pop(0)

            if curr == end:
                return True

            for neighbor, weight in adj[curr]:
                if not visited[neighbor] and dist + weight <= range_val:
                    visited[neighbor] = True
                    queue.append((neighbor, dist + weight))

        return False

    def find_min_range():
        for u, v, w in roads:
            max_dist = 0
            for i in range(n):
                for j in range(n):
                    if i != j:
                        if not is_reachable(i, j, w):
                            max_dist = max(max_dist, w)
                            break
                if max_dist > 0:
                    break

            if max_dist > 0:
                return max_dist

    min_range = find_min_range()
    if min_range == 0:
        print("IMPOSSIBLE")
    else:
        print(min_range)

