        a[x-1] = k

    def reverse(k):
        for i in range(1 << k):
            for j in range(1 << k):
                a[i + j * (1 << k)] = a[i + j * (1 << k)][::-1]

    def swap(k):
        for i in range(1 << k):
            a[i + (i + 1) * (1 << k) - 1] = a[i + (i + 1) * (1 << k) - 1][::-1]

    def sum_query(l, r):
        return sum(a[i-1] for i in range(l, r + 1))

    for _ in range(q):
