    def is_valid(x, y):
        if x < 0 or x >= n or y < 0 or y >= n:
            return False
        return board[x][y] == '#'

    def dfs(x, y, visited):
        if x < 0 or x >= n or y < 0 or y >= n or (x, y) in visited:
            return False
        if board[x][y] == '.':
            return False
        visited.add((x, y))
        return True

    def find_cross(x, y):
        if not is_valid(x, y):
            return False

        visited = set()
        visited.add((x, y))

        # Check horizontal
        if dfs(x - 1, y, visited) and dfs(x + 1, y, visited):
            if dfs(x, y - 1, visited) and dfs(x, y + 1, visited):
                return True

        # Check vertical
        if dfs(x, y - 1, visited) and dfs(x, y + 1, visited):
            if dfs(x - 1, y, visited) and dfs(x + 1, y, visited):
                return True

        return False

    crosses = 0
    for i in range(n):
        for j in range(n):
            if find_cross(i, j):
                crosses += 1

    if crosses * 5 == n * n:
        print("YES")
    else:
        print("NO")

