def find_highest_tower(frogs):
    n = len(frogs)
    positions = [frog[0] for frog in frogs]
    distances = [frog[1] for frog in frogs]

    max_position = max(positions)
    max_size = 0

    for i in range(n):
        for j in range(i + 1, n):
            if distances[i] == distances[j]:
                continue

            pos1 = positions[i]
            pos2 = positions[j]

            if pos1 > pos2:
                pos1, pos2 = pos2, pos1

            if pos1 + distances[i] > pos2:
                continue

            size = 1
            current_pos = pos1

            while current_pos + distances[i] <= pos2:
                current_pos += distances[i]
                size += 1

            if current_pos == pos2:
                max_size = max(max_size, size)
                max_position = pos1

    return max_position, max_size

