        assignments.append((u, v))

    def find(parent, i):
        if parent[i] == i:
            return i
        return find(parent, parent[i])

    def union(parent, rank, x, y):
        xroot = find(parent, x)
        yroot = find(parent, y)

        if rank[xroot] < rank[yroot]:
            parent[xroot] = yroot
        elif rank[xroot] > rank[yroot]:
            parent[yroot] = xroot
        else:
            parent[yroot] = xroot
            rank[xroot] += 1

    def kruskal():
        edges.sort(key=lambda x: x[2])

        parent = list(range(n))
        rank = [0] * n

        min_cost = 0
        edges_used = 0

        for u, v, w in edges:
            if edges_used == 4:
                break

            x = find(parent, u)
            y = find(parent, v)

            if x != y:
                union(parent, rank, x, y)
                min_cost += w
                edges_used += 1

        return min_cost

    print(kruskal())

