    for _ in range(n - 1):
        a, b = map(int, input().split())
        edges.append((a - 1, b - 1))

    import numpy as np
    import scipy.optimize as opt

    def distance(p1, p2):
        return np.linalg.norm(np.array(p1) - np.array(p2))

    def objective(x):
        points = np.array(x).reshape(-1, 2)
        for i, (a, b) in enumerate(edges):
            if distance(points[a], points[b]) < 1:
                return float('inf')
        return 0

    x0 = np.zeros(n * 2)
    res = opt.minimize(objective, x0, method='SLSQP', bounds=[(-3000, 3000), (-3000, 3000)] * n)
    if res.success:
        points = res.x.reshape(-1, 2)
        for point in points:
            print(f"{point[0]:.10f} {point[1]:.10f}")
    else:
        print("No solution found")

