    end_positions = {}
    for i in range(n):
        line = input().split()
        start_positions[line[0]] = line[1]
        end_positions[line[0]] = line[2]

    def can_win(start, end):
        if start == end:
            return 0
        if start not in positions:
            return float('inf')

        min_rounds = float('inf')
        for option in positions[start]:
            if option in end_positions:
                rounds = can_win(option, end_positions[option])
                if rounds != float('inf'):
                    min_rounds = min(min_rounds, rounds + 1)

        return min_rounds

    for start in sorted(start_positions.keys()):
        for end in sorted(end_positions.keys()):
            rounds = can_win(start, end)
            if rounds == float('inf'):
                print("-1", end=" ")
            else:
                print(rounds, end=" ")
        print()

