def solve():
    n, m = map(int, input().split())
    a = list(map(int, input().split()))
    b = list(map(int, input().split()))
    edges = []
    for _ in range(m):
        u, v = map(int, input().split())
        edges.append((u - 1, v - 1))

    def calculate_score(removed_vertices):
        graph = [[] for _ in range(n)]
        for u, v in edges:
            if u not in removed_vertices and v not in removed_vertices:
                graph[u].append(v)
                graph[v].append(u)

        components = []
        visited = [False] * n
        for i in range(n):
            if not visited[i]:
                component = []
                stack = [i]
                while stack:
                    node = stack.pop()
                    if not visited[node]:
                        visited[node] = True
                        component.append(node)
                        stack.extend([j for j in graph[node] if not visited[j]])
                components.append(component)

        score = 0
        for component in components:
            component_sum = sum(b[i] for i in component)
            score += abs(component_sum)
        return score

    max_profit = -float('inf')
    for i in range(1 << n):
        removed_vertices = []
        for j in range(n):
            if (i >> j) & 1:
                removed_vertices.append(j)

        score = calculate_score(removed_vertices)
        profit = score - sum(a[i] for i in removed_vertices)
        max_profit = max(max_profit, profit)

    print(max_profit)

solve()

