def solve():
    n = int(input())
    nums = []
    for _ in range(n):
        nums.append(int(input()))

    MOD = 10**9 + 7

    def gcd(a, b):
        if b == 0:
            return a
        return gcd(b, a % b)

    def lcm(a, b):
        return (a * b) // gcd(a, b)

    def find_lcm(arr):
        result = 1
        for num in arr:
            result = lcm(result, num)
        return result

    def find_gcd(arr):
        result = arr[0]
        for num in arr:
            result = gcd(result, num)
        return result

    def count_ways(nums):
        n = len(nums)
        if n == 1:
            return 1

        lcm_val = find_lcm(nums)

        if lcm_val == 1:
            return 0

        gcd_val = find_gcd(nums)

        if gcd_val == 1:
            return 0

        if gcd_val == lcm_val:
            return 1

        return 0

    result = count_ways(nums)
    print(result % MOD)

solve()

def solve():
    n, m = map(int, input().split())
    p = []
    for _ in range(n + m - 1):
        p.append(float(input()))

    dp = {}

    def prob(a, b):
        if (a, b) in dp:
            return dp[(a, b)]

        if a == 0:
            return 0
        if b == 0:
            return 1

        ans = 0
        for i in range(n + m - 1):
            if p[i] > 0:
                ans += p[i] * prob(a - 1, b) + (1 - p[i]) * prob(a, b - 1)
            else:
                ans += prob(a - 1, b) + prob(a, b - 1)

        dp[(a, b)] = ans
        return ans

    print(prob(n, m))

solve()

