        next_states = []
        for i in range(len(state)):
            if state[i] > 0:
                new_state = state[:]
                new_state[i] -= 1
                next_states.append(tuple(new_state))

        for i in range(len(state)):
            if state[i] % 2 == 0 and state[i] > 0:
                new_state = state[:]
                new_state[i] //= 2
                new_state.extend([k] * (state[i] // 2))
                next_states.append(tuple(new_state))
        return next_states

    def is_losing(state):
        next_states = get_next_states(state)
        for next_state in next_states:
            if not is_winning(next_state):
                return False
        return True

    initial_state = tuple(a)
    if is_winning(initial_state):
        print("Kevin")
    else:
        print("Nicky")

