def solve():
    n = int(input())
    edges = []
    for _ in range(2 * (n - 1)):
        u, v = map(int, input().split())
        edges.append((u, v))

    def is_valid_assignment(edges, assignment):
        left_tree = []
        right_tree = []

        for i, (u, v) in enumerate(edges):
            if assignment[i] == 'L':
                left_tree.append((u, v))
            else:
                right_tree.append((u, v))

        if not left_tree or not right_tree:
            return False

        left_root = 1
        right_root = n

        def build_tree(edges, root):
            tree = {}
            for u, v in edges:
                if u == root:
                    if v not in tree:
                        tree[v] = []
                    tree[u].append(v)
                elif v == root:
                    if u not in tree:
                        tree[u] = []
                    tree[v].append(u)
            return tree

        left_tree_tree = build_tree(left_tree, left_root)
        right_tree_tree = build_tree(right_tree, right_root)

        def check_tree(tree, root):
            if not tree:
                return True
            for child in tree[root]:
                if child not in tree:
                    return False
                if not check_tree(tree, child):
                    return False
            return True

        return check_tree(left_tree_tree, left_root) and check_tree(right_tree_tree, right_root)

    def find_assignment(edges):
        n = len(edges)
        for i in range(1 << n):
            assignment = []
            for j in range(n):
                if (i >> j) & 1:
                    assignment.append('L')
                else:
                    assignment.append('R')

            if is_valid_assignment(edges, assignment):
                return ''.join(assignment)
        return "impossible"

    assignment = find_assignment(edges)
    print(assignment)

solve()

