    line1 = line1.strip()
    line2 = line2.strip()

    if not line1 and not line2:
        return True

    line1 = line1.replace(" ", "")
    line2 = line2.replace(" ", "")

    if not line1 and not line2:
        return True

    line1 = line1.split()
    line2 = line2.split()

    if not line1 and not line2:
        return True

    if len(line1) != len(line2):
        return False

    for i in range(len(line1)):
        if line1[i] != line2[i]:
            return False

    return True

