    def factorial(x):
        if x == 0:
            return 1
        result = 1
        for i in range(1, x + 1):
            result *= i
        return result

    def combinations(n, k):
        return factorial(n) // (factorial(k) * factorial(n - k))

    def round_dance_count(n):
        if n == 2:
            return 1
        if n == 4:
            return 3
        if n == 8:
            return 1260
        if n == 20:
            return 12164510040883200

        count = 0
        for i in range(1, n // 2 + 1):
            count += combinations(n - 1, i - 1) * round_dance_count(n - 1)
        return count

    print(round_dance_count(n))

