    edges = []
    for _ in range(m):
        u, v = map(int, input().split())
        edges.append((u, v))

    def is_valid_orientation(orientation):
        adj = [[] for _ in range(n + 1)]
        for i in range(m):
            u, v = edges[i]
            if orientation[i] == '0':
                adj[u].append(v)
            else:
                adj[v].append(u)

        visited = [False] * (n + 1)
        def dfs(node, parent):
            visited[node] = True
            for neighbor in adj[node]:
                if not visited[neighbor]:
                    if dfs(neighbor, node):
                        return True
                elif neighbor != parent:
                    return True
            return False

        for i in range(1, n + 1):
            if not visited[i]:
                if dfs(i, -1):
                    return False
        return True

    for orientation in ['0' * m, '1' * m]:
        if is_valid_orientation(orientation):
            print("YES")
            print(orientation)
            return

    print("NO")

