        if not nums:
            return 0
        if len(nums) == 1:
            return nums[0]

        res = set()
        for i in range(1, len(nums), 2):
            for j in range(i, len(nums), 2):
                if j == i:
                    res.add(evaluate(nums[:i], ops[:i]) + evaluate(nums[i+1:], ops[i+1:]))
                else:
                    res.add(evaluate(nums[:i], ops[:i]) + evaluate(nums[i+1:j], ops[i+1:j]) + evaluate(nums[j+1:], ops[j+1:]))
        return len(res)

    print(evaluate(nums, ops))

